import React from "react";
import Navbar from "../Navbar";
import Landing from "./Landing";
import Benifits from "./Benifits";
import "./index.css";
import Generator from "../Generator";

const Homepage = ({panels,setPanels}) => {
  return (
    <div className="HomeWrapper">
      <div className="homeSection">
        <Navbar panels={panels}></Navbar>
      </div>
      <div className="homeSection">
        <Landing
          heading2="Taking your progress to the next level, In this fast world, Comics is a great way to relive our childhood, Wanna create your own Comic by just inputting some text, Let our AI do the work ! "
        ></Landing>
      </div>
      <div className="homeSection">
        <Benifits></Benifits>
      </div>
      <div className="homeSection">
        <Generator
          panels={panels}
          setPanels={setPanels}
        ></Generator>
      </div>
    </div>
  );
};

export default Homepage;
